import Axios from "axios";
import {useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    Axios.get('http://localhost:5000')
    .then((res) => {
      setData(res.data)
      console.log(res.data)
    })
  })

  return (
    data == null ? (
      <div className="App">
        no data 
      </div>
    ) : (
      <div className="App">
        {
          data.map((item)=>{
            <p></p>
          })
        }
    </div>
    )
  );
}

export default App;
